import React from 'react'
import Slider from 'react-slick'

import './olahraga.css'
import 'slick-carousel/slick/slick.css'
import 'slick-carousel/slick/slick-theme.css'

import { KometisiList } from '../../components/index'
import tes from '../../assets/tes.png'

const olahragaData = [
  {
    olahragaImage: tes,
    olahName: 'Olahraga 1'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 2'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 3'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 4'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 5'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 6'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 7'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 8'
  },
  {
    olahragaImage: tes,
    olahName: 'Olahraga 9'
  }
]

const Olahraga = () => {

  let settings = {
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3,
    cssEase: 'linear'
  }

  return (
    <div className='spirit__kompetisi_olahraga section__padding' id='olahraga'>
        <div className='spirit__kompetisi-heading_olahraga'>
            <h1>OLAHRAGA</h1>
        </div>
        <div className='spirit__kompetisi_olahraga-container'>
          <Slider {...settings}>
            {olahragaData.map((item, index) => (
              <KometisiList kompetisiImage={item.olahragaImage} kompetisiName={item.olahragaName} />
            ))}
          </Slider>
        </div>
    </div>
  )
}

export default Olahraga
